textOriginal:
A indignação do Ferréz é digna e justa!

Meu foco agora é em quem não votou, votou nulo ou em branco

Pois os que votaram no bobo e seus miquinhos amestrados eu não tenho papo meu amigo

Principalmente os que como eu são protestantes

Esses literalmente fecharam os olhos para o entorno, para a miséria a sua volta e que a maioria está inclusa

Preferem ignorar os 700.000 mortos!

Preferem ignorar os roubos do governo e dos representantes das igrejas na pandemia!

Preferem ignorar que esse homem em todo tempo humilha as mulheres!

Preferem ignorar a tentativa constante de destruição:

Da Educação;
Do SUS;
Da Farmácia Popular;
Da Urna Eletrônica;
Da Petrobrás;
Do prestígio internacional;

Eu não consigo ignorar. Nesse momento na história o que pode ser feito para tirar essa cabeça apodrecida da presidência é sim votar 13 no 2º Turno das Eleições!
